import React from "react";
import { Slider, Slide, Caption } from "react-materialize";

import "./howto.css";

const HowTo = props => {
    return (
        <Slider
  fullscreen={false}
  options={{
    duration: 500,
    height: 400,
    indicators: true,
    interval: 6000
  }}
>
  <Slide image={<img alt="Blue Background" src="https://s17736.pcdn.co/wp-content/uploads/2019/04/03-deep-blue-1024x576.jpg" />}>
    <Caption placement="left">
      <h3>
        How it works
      </h3>
      <h5 className="light grey-text text-lighten-3">
        Describe how it works (maybe put a time limit ie: "It takes 5 minutes to fill out, and you'll be on your way")
      </h5>
    </Caption>
  </Slide>
  <Slide image={<img alt="" src="http://lorempixel.com/780/580/nature/2"/>}>
    <Caption placement="center">
      <h3>
        What we do for you(or something else)
      </h3>
      <h5 className="light grey-text text-lighten-3">
        Describe here. 
      </h5>
    </Caption>
  </Slide>
</Slider>
    )
};

export default HowTo;
